import React, {FC} from "react";
import {Grid, Typography} from "@material-ui/core";
import {CustomMenu} from "@src/components/elements/custom_menu/CustomMenu";


export const AdvertisementCreateData: FC<any> = (props) => {
    const {data, values, onBlur, handleClickMenuItem} = props;
    const dataKeys = Object.keys(data);

    return (
        <Grid container>
            {
                dataKeys.map((value) => {
                    if (value !== 'id' && value !== 'name') {
                        return (
                            <Grid
                                key={value}
                                item
                                xs={12}
                                sm={4}
                                container
                                direction='column'
                                justify='flex-end'
                            >
                                <Typography variant="subtitle1">
                                    <strong>
                                        {value}
                                    </strong>
                                </Typography>
                                <CustomMenu
                                    valueName={values.adSubCategory.name}
                                    items={values.adCategory.childs}
                                    onBlur={onBlur}
                                    onClick={handleClickMenuItem(value)}
                                />
                            </Grid>
                        )
                    }
                })
            }
        </Grid>
    )
};
